import { type } from './../action';

const initialState = {
  studentID: '',
  studentPassword: '',
  studentMajor: '',
};

export default (state = initialState, action)=>{
  switch (action) {
    case type.STUDENT_DATA :
      return{
        ...state,
        studentID: action.studentID,
        studentPassword: action.studentPassword,
        studentMajor: action.studentMajor,
      };
    default :
      break;
  }
}
